const Main = () => {
  const data = {
    items: [
      {
        imagePath: "https://picsum.photos/1000/1000?random=11",
        views: 0,
        likes: 0,
        name: "NAME",
        date: "YYYY-MM-DD",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=1",
        views: 100,
        likes: 20,
        name: "Nature Beauty",
        date: "2023-05-15",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=2",
        views: 256,
        likes: 15,
        name: "City Lights",
        date: "2023-02-28",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=3",
        views: 75,
        likes: 8,
        name: "Abstract Art",
        date: "2023-08-10",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=4",
        views: 500,
        likes: 50,
        name: "Sunset Horizon",
        date: "2023-11-20",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=5",
        views: 120,
        likes: 12,
        name: "Vintage Vibes",
        date: "2023-04-05",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=6",
        views: 320,
        likes: 25,
        name: "Adventure Awaits",
        date: "2023-09-18",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=7",
        views: 180,
        likes: 18,
        name: "Winter Wonderland",
        date: "2023-12-25",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=8",
        views: 90,
        likes: 10,
        name: "Epic Landscape",
        date: "2023-07-02",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=9",
        views: 420,
        likes: 30,
        name: "Galactic Dreams",
        date: "2023-03-12",
      },
      {
        imagePath: "https://picsum.photos/1000/1000?random=10",
        views: 150,
        likes: 22,
        name: "Serenity at Sea",
        date: "2023-06-08",
      },
    ],
  };
  console.log(data);

  return (
    <>
      <main>
        <div className="main-container">
          <div className="result-container">
            <div className="result-pagination">
              <div className="result-pag-item">Option1</div>
              <div className="result-pag-item">Option2</div>
              <div className="result-pag-item">Option3</div>
            </div>
            <div className="result-grid">
              {data.items.map((element) => (
                <div key={element.name} className="result-grid-element">
                  <div
                    className="result-img"
                    style={{
                      backgroundImage: `url("${element.imagePath}")`,
                    }}
                  ></div>
                  <div className="result-text">
                    <div className="result-title">{element.name}</div>
                    <div className="result-analitics-container">
                      <div className="result-analitics-item">
                        Likes: {element.likes}
                      </div>
                      <div className="result-analitics-item">
                        Added: {element.date}
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </>
  );
};

export default Main;
